import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './priceprediction.css';

const PricePrediction = () => {
  const [activeTab, setActiveTab] = useState('price-prediction');
  const [showProfileDropdown, setShowProfileDropdown] = useState(false);
  const [formData, setFormData] = useState({
    propertyType: '',
    address: '',
    floorArea: '',
    level: '',
    unit: ''
  });
  const navigate = useNavigate();

  const navigationItems = [
    { id: 'dashboard', label: 'Dashboard', icon: 'üè†' },
    { id: 'price-prediction', label: 'Price Prediction', icon: 'üìà' },
    { id: 'bookmarks', label: 'Bookmarks', icon: 'üîñ' },
    { id: 'support', label: 'Support', icon: '‚ùì' },
    { id: 'feedback', label: 'Feedback', icon: 'üí¨' },
    { id: 'profile', label: 'Profile', icon: 'üë§' }
  ];

  const propertyTypes = [
    'Industrial Property',
    'Commercial Space',
    'Warehouse',
    'Office Space',
    'Retail Unit',
    'Factory Building'
  ];

  const levels = [
    'Ground Floor',
    'Level 1',
    'Level 2',
    'Level 3',
    'Level 4',
    'Level 5+'
  ];

  const recentSearches = [
    {
      id: 1,
      propertyType: 'Industrial Property',
      address: '123 Main Street, Singapore'
    },
    {
      id: 2,
      propertyType: 'Commercial Space',
      address: '456 Oak Avenue, Singapore'
    },
    {
      id: 3,
      propertyType: 'Warehouse',
      address: '789 Pine Lane, Singapore'
    }
  ];

  const handleProfileClick = () => {
    setShowProfileDropdown(!showProfileDropdown);
  };

  const handleProfilePage = () => {
    setShowProfileDropdown(false);
    navigate('/profile');
  };

  const handleLogout = () => {
    setShowProfileDropdown(false);
    localStorage.removeItem('isLoggedIn');
    localStorage.removeItem('userType');
    localStorage.removeItem('userPreferences');
    navigate('/login');
  };

  const handleClickOutside = (e) => {
    if (!e.target.closest('.user-profile')) {
      setShowProfileDropdown(false);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSearch = (e) => {
    e.preventDefault();
    // Handle search logic here
    console.log('Search data:', formData);
  };

  const handleRecentSearchClick = (search) => {
    setFormData({
      propertyType: search.propertyType,
      address: search.address,
      floorArea: '',
      level: '',
      unit: ''
    });
  };

  // Add click listener to close dropdown when clicking outside
  React.useEffect(() => {
    document.addEventListener('click', handleClickOutside);
    return () => {
      document.removeEventListener('click', handleClickOutside);
    };
  }, []);

  return (
    <div className="price-prediction-dashboard">
      {/* Top Header */}
      <header className="dashboard-header">
        <div className="header-center">
          <div className="logo">
            <span className="logo-icon">üè†</span>
            <span className="logo-text">Valuez</span>
          </div>
        </div>
        <div className="header-right">
          <div className="notification-icon">üîî</div>
          <div className="user-profile">
            <img 
              src="https://images.unsplash.com/photo-1494790108755-2616b612b786?w=40&h=40&fit=crop&crop=face" 
              alt="User Profile" 
              className="profile-image"
              onClick={handleProfileClick}
            />
            {showProfileDropdown && (
              <div className="profile-dropdown">
                <div className="dropdown-item" onClick={handleProfilePage}>
                  <span className="dropdown-icon">üë§</span>
                  <span>Profile</span>
                </div>
                <div className="dropdown-divider"></div>
                <div className="dropdown-item" onClick={handleLogout}>
                  <span className="dropdown-icon">üö™</span>
                  <span>Logout</span>
                </div>
              </div>
            )}
          </div>
        </div>
      </header>

      <div className="dashboard-container">
        {/* Left Sidebar */}
        <aside className="sidebar">
          <nav className="sidebar-nav">
            {navigationItems.map((item) => (
              <button
                key={item.id}
                className={`nav-item ${activeTab === item.id ? 'active' : ''}`}
                onClick={() => setActiveTab(item.id)}
              >
                <span className="nav-icon">{item.icon}</span>
                <span className="nav-label">{item.label}</span>
              </button>
            ))}
          </nav>
        </aside>

        {/* Main Content */}
        <main className="main-content">
          <div className="content-header">
            <h1 className="main-title">Get Sales Price Prediction</h1>
          </div>

          <div className="search-section">
            <form onSubmit={handleSearch} className="search-form">
              <div className="form-group">
                <label htmlFor="propertyType">Property Type</label>
                <select
                  id="propertyType"
                  name="propertyType"
                  value={formData.propertyType}
                  onChange={handleInputChange}
                  required
                >
                  <option value="">Select property type</option>
                  {propertyTypes.map((type, index) => (
                    <option key={index} value={type}>{type}</option>
                  ))}
                </select>
              </div>

              <div className="form-group">
                <label htmlFor="address">Address</label>
                <input
                  type="text"
                  id="address"
                  name="address"
                  value={formData.address}
                  onChange={handleInputChange}
                  placeholder="Search for address"
                  required
                />
              </div>

              <div className="map-snippet">
                <div className="map-container">
                  <div className="map-labels">
                    <div className="map-label">Nature Park</div>
                    <div className="map-label">Tree Top Walk</div>
                    <div className="map-label">BUKIT BATOK</div>
                    <div className="map-label">TENGAH</div>
                    <div className="map-label">JURONG EAST</div>
                    <div className="map-label">ANG MO KIO</div>
                    <div className="map-label">Junction 8</div>
                    <div className="map-label">NEX</div>
                    <div className="map-label">BISHAN</div>
                    <div className="map-label">HOUGANG</div>
                    <div className="map-label">Singapore Air Force Museum</div>
                    <div className="map-label">TOA PAYOH</div>
                  </div>
                  <div className="map-pins">
                    <div className="map-pin">üìç</div>
                    <div className="map-pin">üìç</div>
                    <div className="map-pin">üìç</div>
                  </div>
                </div>
              </div>

              <div className="form-row">
                <div className="form-group">
                  <label htmlFor="floorArea">Floor Area (sq ft)</label>
                  <input
                    type="number"
                    id="floorArea"
                    name="floorArea"
                    value={formData.floorArea}
                    onChange={handleInputChange}
                    placeholder="Enter floor area"
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="level">Level</label>
                  <select
                    id="level"
                    name="level"
                    value={formData.level}
                    onChange={handleInputChange}
                    required
                  >
                    <option value="">Select level</option>
                    {levels.map((level, index) => (
                      <option key={index} value={level}>{level}</option>
                    ))}
                  </select>
                </div>

                <div className="form-group">
                  <label htmlFor="unit">Unit</label>
                  <input
                    type="text"
                    id="unit"
                    name="unit"
                    value={formData.unit}
                    onChange={handleInputChange}
                    placeholder="Enter unit number"
                    required
                  />
                </div>
              </div>

              <button type="submit" className="search-btn">
                Search
              </button>
            </form>
          </div>
        </main>

        {/* Right Sidebar - Recent Searches */}
        <aside className="recent-searches-sidebar">
          <h2 className="sidebar-title">Recent Searches</h2>
          <div className="recent-searches-list">
            {recentSearches.map((search) => (
              <div 
                key={search.id} 
                className="recent-search-item"
                onClick={() => handleRecentSearchClick(search)}
              >
                <span className="search-icon">üîç</span>
                <div className="search-details">
                  <div className="search-property-type">{search.propertyType}</div>
                  <div className="search-address">{search.address}</div>
                </div>
              </div>
            ))}
          </div>
        </aside>
      </div>

      {/* Footer */}
      <footer className="dashboard-footer">
        <div className="footer-left">
          <a href="/terms" className="footer-link">Terms</a>
          <a href="/privacy" className="footer-link">Privacy</a>
        </div>
        <div className="footer-center">
          <span className="copyright">¬© 2024 Valuez. All rights reserved.</span>
        </div>
        <div className="footer-right">
          <a href="/contact" className="footer-link">Contact</a>
          <a href="/disclaimer" className="footer-link">Disclaimer</a>
        </div>
      </footer>
    </div>
  );
};

export default PricePrediction;
